import { container, title } from "assets/jss/material-kit-react.jsx";

const ContactStyle = {
  container: {
    zInde: "12",
    color: "#ffffff",
    ...container
  },
  section: {
    padding: "70px 0"
  },
  title: {
    ...title,
    marginBottom: "1rem",
    marginTop: "30px",
    minHeight: "32px",
    textDecoration: "none"
  },
  description: {
    color: "#999",
    textAlign: "center"
  },
  textCenter: {
    textAlign: "center"
  },
  textArea: {
    marginRight: "15px",
    marginLeft: "15px"
  }
};

export default ContactStyle;
